import React, { useState } from "react";
import { Link } from "react-router-dom";
import "./Table5.css";

const DropdownItem = ({ label }) => {
  return <button className="dropdown-item">{label}</button>;
};

const Table5 = () => {
  const [isDropdownOpen, setIsDropdownOpen] = useState(false);

  const toggleDropdown = () => {
    setIsDropdownOpen(!isDropdownOpen);
  };

  return (
    <>
      <br />
      <nav className="header-container">
        <div className="ui fixed">
          <div className="header-content">
            <div className="back-container">
              <Link to="/reports">
                <button className="btn btn-secondary">Back</button>
              </Link>
            </div>
            <div className="dropdown-container">
              <div className="dropdown">
                <button
                  className="nav-link btn btn-link dropdown-toggle"
                  id="navbarDropdown"
                  data-toggle="dropdown"
                  aria-haspopup="true"
                  aria-expanded={isDropdownOpen}
                  onClick={toggleDropdown}
                >
                  Dropdown
                </button>
                {isDropdownOpen && (
                  <div className="dropdown-menu dropdown-menu-right show">
                    <DropdownItem label="1-100" />
                    <DropdownItem label="100-1000" />
                    <DropdownItem label="1000-10000" />
                    <DropdownItem label="10000-50000" />
                    <DropdownItem label="50000-100000" />
                    <DropdownItem label="100000 and above" />
                  </div>
                )}
              </div>
            </div>
          </div>
        </div>
      </nav>
    </>
  );
};

export default Table5;
